						["custom"] = "function(allstates, event, _, message, _, sourceGUID, sourceName, sourceFlags, _, _, _, _, _, _, spellName)\n    local timestamp = GetTime()\n    local earthShock = GetSpellInfo(8042)\n    \n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" and message == \"SPELL_CAST_SUCCESS\" and bit.band(sourceFlags, COMBATLOG_OBJECT_TYPE_PLAYER) > 0 and spellName == earthShock then\n        \n        allstates[timestamp] = allstates[timestamp] or {}         \n        \n        local state = allstates[timestamp]\n        \n        \n        local duration = 6\n        \n        \n        state.name = sourceName\n        state.duration = duration\n        state.spellid = spellid\n        state.progressType = 'timed'\n        state.expirationTime = timestamp + duration\n        state.autoHide = true\n        state.changed = true\n        state.show = true          \n        \n        \n    end\n    return true\nend",
